:::



__Visualization: Assessing Normality__    


::: {.cell}
::: {.cell-output-display}
![](index_files/figure-html/unnamed-chunk-40-1.png){width=672}
:::
:::



__Traditional Method: Assessing Normality, Shapiro Wilkes Test__    


::: {.cell}

```{.r .cell-code}
# shapiro wilk test
parsimonious_residuals <- resid(parsimonious_model)
shapiro.test(parsimonious_residuals)
```

::: {.cell-output .cell-output-stdout}
```

	Shapiro-Wilk normality test

data:  parsimonious_residuals
W = 0.68628, p-value < 2.2e-16
```
:::
:::

_Note: residuals are normal but there is not solid linearity (as seen in the Normal Q-Q plot) so more needs to be explored_    


### Transforming CRP     

<font color = "purple">   
**Note**: I decided to show the transformation of the outcome variable since that is ideally something we should have checked earlier on. I also just like how satisfying it is to see the before and after effects.   
<font>   


